import './App.css';
import RatingScale from './components/RatingScale';
import './icons/icon-star.svg'

function App() {
  return (
    <div className="App">
      <h1>Noice From App</h1>
      <img src="icon" alt='icon star'/>
      <RatingScale />
    </div>
  );
}

export default App;
